import React from 'react';


const LoginView = () => {
return (
  <div className='form-container'>
    <form id='signin-form'>
      <ul className='form-items'>
        <li>
          <h1>SignIn</h1>
        </li>
        <li>
          <label htmlFor='email'>Email</label>
          <input type='email' />
        </li>
      </ul>
    </form>

  </div>
);
};

export default LoginView;
